import React, { useState } from 'react';
import './App.css';
import logo from './Pictures/plogo.png';
import { Button, Form, Container, Row, Col } from 'react-bootstrap';
import axios from "axios";

const Careers = () => {
  // Define state for form data
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    message: ""
  });

  // Handle form input changes
  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  // Handle form submission
  const handleSubmit = (event) => {
    event.preventDefault();
    // Make POST request to your backend
    axios.post('http://localhost:4000/ContactPage', formData)
      .then(response => {
        alert('Message sent successfully!');
        console.log(response.data);
      })
      .catch(error => {
        console.error('Failed to send message:', error);
        alert('Failed to send message.');
      });

    // Optionally reset form after sending
    setFormData({
      firstName: "",
      lastName: "",
      email: "",
      message: ""
    });
  };
  const NavbarComponent = () => {
    return (
      <nav className="navbar">
        <Container>
          <div className="logo">
            <img style={{ width: '200px', height: '80%' }} src={logo} alt="Logo" />
          </div>
          <ul className="nav-links">
            <li><a href="/valet-parking">Valet Parking</a></li>
            <li><a href="/commercial-services">Commercial Services</a></li>
            <li><a href="/locations">Locations</a></li>
            <li><a href="/Careers">Careers</a></li>
            <li><a href="/about">About</a></li>
            <li><a href="/ContactPage">Contact</a></li>
          </ul>
          <button className="quote-btn" style={{ padding:'13px', color:'black', fontSize:'20px'}}> <a href="Quote" style={{color:'black', textDecoration: 'none'  }}>Request a Quote</a> </button>
        </Container>
      </nav>
    );
  };

  return (
    <div>
      <div>
      {NavbarComponent()}
      </div>
    <Container >
      <Row>
        <Col md={8}>
          <h1>Valet Attendant, Part Time $19/hr (San Jose, CA)</h1>
          <h3>Job Details</h3>
          <p><strong>Location:</strong> San Jose, CA</p>
          <p><strong>Position Type:</strong> Part Time</p>
          <p><strong>Salary Range:</strong> $19.00 - $19.00 Hourly</p>
          <p><strong>Job Category:</strong> Transportation</p>

          <h3>Description</h3>
          <p>All About Parking Inc. is an equal opportunity employer, dedicated to a policy of non-discrimination in employment on any basis including race, creed, color, age, sex, religion or national origin. All employees are subject to a successful completion of a background check.</p>
          <p><strong>Primary Responsibility:</strong> The primary responsibility of the Attendant is to provide client-facing support for valet parking, Electric Vehicles (EVs) management, and driving operations, which includes greeting incoming and outgoing customers, parking and retrieving customer vehicles, answering customer questions in a professional, welcoming manner, and driving other employees and guests to and from designated areas. Additional duties could include providing directions on available parking, assisting in improving traffic control patterns, and keeping and retrieving car keys.</p>

          <h3>General Duties and Responsibilities:</h3>
          <ul>
            <li>Comply with all company policies and procedures.</li>
            <li>Assist in maintaining station operations.</li>
            <li>Maintain a clean and orderly work environment including relief of car backlog.</li>
            <li>Perform other duties as assigned.</li>
          </ul>

          <h3>Qualifications</h3>
          <ul>
            <li>Must be at least 19 years of age.</li>
            <li>Must possess a valid drivers license with no accidents or 2-point driving infractions in the last 5 years.</li>
            <li>High School diploma or equivalent preferred.</li>
          </ul>
        </Col>
        <Col md={4}>
          <Form>
            <h2>Apply Now</h2>
            <Form.Group className="mb-3">
              <Form.Label>Legal First Name*</Form.Label>
              <Form.Control type="text" placeholder="Enter first name" required />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>Legal Last Name*</Form.Label>
              <Form.Control type="text" placeholder="Enter last name" required />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>Email*</Form.Label>
              <Form.Control type="email" placeholder="Enter email" required />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>Confirm Email*</Form.Label>
              <Form.Control type="email" placeholder="Confirm email" required />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>Phone*</Form.Label>
              <Form.Control type="tel" placeholder="Enter phone number" required />
            </Form.Group>
            <Button variant="primary" type="submit">
              Start Application
            </Button>
          </Form>
        </Col>
      </Row>
    </Container>
    </div>
  );
}

export default Careers;
